(2,'H5P.Accordion','Accordion',1,0,33,1,0,'iframe','h5p-accordion.js','h5p-accordion.css','','[\n  {\n    \"name\": \"panels\",\n    \"type\": \"list\",\n    \"label\": \"Panels\",\n    \"entity\": \"panel\",\n    \"max\": 100,\n    \"min\": 1,\n    \"field\": {\n      \"name\": \"content\",\n      \"type\": \"group\",\n      \"label\": \"Content\",\n      \"importance\": \"high\",\n      \"entity\": \"content\",\n      \"fields\": [\n        {\n          \"name\": \"title\",\n          \"type\": \"text\",\n          \"label\": \"Title\",\n          \"importance\": \"high\"\n        },\n        {\n          \"name\": \"content\",\n          \"type\": \"library\",\n          \"label\": \"Content type\",\n          \"importance\": \"medium\",\n          \"entity\": \"content\",\n          \"options\": [\n            \"H5P.AdvancedText 1.1\"\n          ]\n        }\n      ]\n    }\n  },\n  {\n    \"name\": \"hTag\",\n    \"type\": \"select\",\n    \"label\": \"H tags for labels (does not affect the size of the label)\",\n    \"importance\": \"low\",\n    \"description\": \"The h tag used on the labels. Normally H2 but if this belongs under an H2 heading use H3. Does not affect the size of the labels, only used for semantical purposes.\",\n    \"options\": [\n      {\n        \"value\": \"h2\",\n        \"label\": \"H2\"\n      },\n      {\n        \"value\": \"h3\",\n        \"label\": \"H3\"\n      },\n      {\n        \"value\": \"h4\",\n        \"label\": \"H4\"\n      }\n    ],\n    \"default\": \"h2\"\n  }\n]\n',NULL,1,5,NULL,NULL,NULL,1),
