(4,'H5P.DocumentationTool','Documentation Tool',1,8,27,1,0,'iframe','navigation-menu.js, documentation-tool.js','navigation-menu.css, documentation-tool.css','','[\n  {\n    \"name\": \"taskDescription\",\n    \"label\": \"Heading\",\n    \"importance\": \"high\",\n    \"type\": \"text\",\n    \"default\": \"Documentation tool\",\n    \"description\": \"Title for the documentation tool.\",\n    \"optional\": true\n  },\n  {\n    \"name\": \"pagesList\",\n    \"label\": \"Elements\",\n    \"importance\": \"high\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      }\n    ],\n    \"min\": 1,\n    \"entity\": \"page\",\n    \"field\": {\n      \"name\": \"page\",\n      \"type\": \"library\",\n      \"label\": \"Page type\",\n      \"importance\": \"high\",\n      \"description\": \"Library for this slide.\",\n      \"options\": [\n        \"H5P.StandardPage 1.5\",\n        \"H5P.GoalsPage 1.5\",\n        \"H5P.GoalsAssessmentPage 1.4\",\n        \"H5P.DocumentExportPage 1.5\"\n      ]\n    }\n  },\n  {\n    \"label\": \"Localize documentation tool buttons\",\n    \"name\": \"i10n\",\n    \"type\": \"group\",\n    \"common\": true,\n    \"collapsed\": true,\n    \"importance\": \"low\",\n    \"fields\": [\n      {\n        \"label\": \"Previous button label\",\n        \"name\": \"previousLabel\",\n        \"type\": \"text\",\n        \"default\": \"Previous documentation step\",\n        \"importance\": \"low\"\n      },\n      {\n        \"label\": \"Next button label\",\n        \"name\": \"nextLabel\",\n        \"type\": \"text\",\n        \"default\": \"Next documentation step\",\n        \"importance\": \"low\"\n      },\n      {\n        \"label\": \"Close button label\",\n        \"name\": \"closeLabel\",\n        \"type\": \"text\",\n        \"default\": \"Close\",\n        \"importance\": \"low\"\n      }\n    ]\n  }\n]\n',NULL,1,19,NULL,'https://h5p.org/tutorial-documentation-tool