(17,'H5P.ArithmeticQuiz','Arithmetic Quiz',1,1,25,1,0,'iframe','js/algebra.min.js, js/arithmetic-quiz.js, js/sound-effects.js, js/countdown-widget.js, js/timer-widget.js, js/intro-page.js, js/qe-generator.js, js/qa-generator.js, js/game-page.js, js/result-page.js, js/odometer.min.js','css/arithmetic-quiz.css, css/odometer-theme-default.css','','[\n  {\n    \"name\": \"intro\",\n    \"type\": \"text\",\n    \"label\": \"Intro\",\n    \"importance\": \"high\",\n    \"description\": \"The intro text (maximum 100 characters)\",\n    \"maxLength\": 100,\n    \"optional\": true\n  },\n  {\n    \"name\": \"quizType\",\n    \"type\": \"select\",\n    \"label\": \"Quiz type\",\n    \"importance\": \"high\",\n    \"options\": [\n      {\n        \"value\": \"arithmetic\",\n        \"label\": \"Arithmetic Operations Quiz\"\n      },\n      {\n        \"value\": \"linearEquation\",\n        \"label\": \"Linear Equations Quiz\"\n      }\n    ],\n    \"default\": \"arithmetic\"\n  },\n  {\n    \"name\": \"arithmeticType\",\n    \"type\": \"select\",\n    \"label\": \"Arithmetic type\",\n    \"widget\": \"showWhen\",\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"quizType\",\n          \"equals\": [\n            \"arithmetic\"\n          ]\n        }\n      ]\n    },\n    \"importance\": \"high\",\n    \"options\": [\n      {\n        \"value\": \"addition\",\n        \"label\": \"Addition\"\n      },\n      {\n        \"value\": \"subtraction\",\n        \"label\": \"Subtraction\"\n      },\n      {\n        \"value\": \"multiplication\",\n        \"label\": \"Multiplication\"\n      },\n      {\n        \"value\": \"division\",\n        \"label\": \"Division\"\n      }\n    ],\n    \"default\": \"addition\"\n  },\n  {\n    \"name\": \"equationType\",\n    \"type\": \"select\",\n    \"label\": \"Equation type\",\n    \"widget\": \"showWhen\",\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"quizType\",\n          \"equals\": [\n            \"linearEquation\"\n          ]\n        }\n      ]\n    },\n    \"importance\": \"high\",\n    \"options\": [\n      {\n        \"value\": \"basic\",\n        \"label\": \"Basic [ 3x = 12 ]\"\n      },\n      {\n        \"value\": \"intermediate\",\n        \"label\": \"Intermediate [ 4x - 3 = 13 ]\"\n      },\n      {\n        \"value\": \"advanced\",\n        \"label\": \"Advanced [ 5x + 3 = 3x + 15 ]\"\n      }\n    ],\n    \"default\": \"intermediate\"\n  },\n  {\n    \"name\": \"useFractions\",\n    \"type\": \"boolean\",\n    \"label\": \"Enable fractions\",\n    \"description\": \"Enable to allow fractions in equations.\",\n    \"default\": false,\n    \"widget\": \"showWhen\",\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"quizType\",\n          \"equals\": [\n            \"linearEquation\"\n          ]\n        }\n      ]\n    }\n  },\n  {\n    \"name\": \"maxQuestions\",\n    \"type\": \"number\",\n    \"label\": \"Max number of questions\",\n    \"importance\": \"medium\",\n    \"default\": 20,\n    \"min\": 2,\n    \"max\": 100\n  },\n  {\n    \"name\": \"UI\",\n    \"type\": \"group\",\n    \"label\": \"User interface translations\",\n    \"importance\": \"low\",\n    \"common\": true,\n    \"fields\": [\n      {\n        \"name\": \"score\",\n        \"type\": \"text\",\n        \"label\": \"Scoring during quiz\",\n        \"importance\": \"low\",\n        \"default\": \"Score:\"\n      },\n      {\n        \"name\": \"time\",\n        \"type\": \"text\",\n        \"label\": \"Time\",\n        \"importance\": \"low\",\n        \"default\": \"Time: @time\"\n      },\n      {\n        \"name\": \"resultPageHeader\",\n        \"type\": \"text\",\n        \"label\": \"Result page header\",\n        \"importance\": \"low\",\n        \"default\": \"Finished!\"\n      },\n      {\n        \"name\": \"go\",\n        \"type\": \"text\",\n        \"label\": \"Go label\",\n        \"importance\": \"low\",\n        \"default\": \"GO!\"\n      },\n      {\n        \"name\": \"startButton\",\n        \"type\": \"text\",\n        \"label\": \"Start button label\",\n        \"importance\": \"low\",\n        \"default\": \"Start\"\n      },\n      {\n        \"name\": \"retryButton\",\n        \"type\": \"text\",\n        \"label\": \"Retry button label\",\n        \"importance\": \"low\",\n        \"default\": \"Retry\"\n      },\n      {\n        \"name\": \"correctText\",\n        \"type\": \"text\",\n        \"label\": \"Readspeaker text for correct answer\",\n        \"importance\": \"low\",\n        \"default\": \"Correct\"\n      },\n      {\n        \"name\": \"incorrectText\",\n        \"type\": \"text\",\n        \"label\": \"Readspeaker text for incorrect answer\",\n        \"importance\": \"low\",\n        \"default\": \"Incorrect. Correct answer was :num\"\n      },\n      {\n        \"name\": \"durationLabel\",\n        \"type\": \"text\",\n        \"label\": \"Readspeaker label for the timer\",\n        \"importance\": \"low\",\n        \"default\": \"Duration in hours, minutes and seconds.\"\n      },\n      {\n        \"name\": \"humanizedQuestion\",\n        \"type\": \"text\",\n        \"label\": \"Readspeaker text for question\",\n        \"importance\": \"low\",\n        \"default\": \"What does :arithmetic equal?\"\n      },\n      {\n        \"name\": \"humanizedEquation\",\n        \"type\": \"text\",\n        \"label\": \"Readspeaker text for equation question\",\n        \"importance\": \"low\",\n        \"default\": \"For the equation :equation, what does :item equal?\"\n      },\n      {\n        \"name\": \"humanizedVariable\",\n        \"type\": \"text\",\n        \"label\": \"Readspeaker text for equation variable\",\n        \"importance\": \"low\",\n        \"default\": \"What does :item equal?\"\n      },\n      {\n        \"name\": \"plusOperator\",\n        \"type\": \"text\",\n        \"label\": \"Plus operator text\",\n        \"importance\": \"low\",\n        \"default\": \"plus\"\n      },\n      {\n        \"name\": \"subtractionOperator\",\n        \"type\": \"text\",\n        \"label\": \"Subtraction operator text\",\n        \"importance\": \"low\",\n        \"default\": \"minus\"\n      },\n      {\n        \"name\": \"multiplicationOperator\",\n        \"type\": \"text\",\n        \"label\": \"Multiplication operator text\",\n        \"importance\": \"low\",\n        \"default\": \"times\"\n      },\n      {\n        \"name\": \"divisionOperator\",\n        \"type\": \"text\",\n        \"label\": \"Division operator text\",\n        \"importance\": \"low\",\n        \"default\": \"delt på\"\n      },\n      {\n        \"name\": \"equalitySign\",\n        \"type\": \"text\",\n        \"label\": \"Equality sign text\",\n        \"importance\": \"low\",\n        \"default\": \"equals\"\n      },\n      {\n        \"name\": \"slideOfTotal\",\n        \"type\": \"text\",\n        \"label\": \"Slide number text\",\n        \"importance\": \"low\",\n        \"description\": \"Announces current slide and total number of slides, variables are :num and :total\",\n        \"default\": \"Slide :num of :total\"\n      }\n    ]\n  }\n]\n',NULL,NULL,NULL,NULL,'https://h5p.org/tutorial-arithmetic-quiz','https://h5p.org/arithmetic-quiz',1),
