(22,'H5P.Audio','Audio',1,5,12,1,0,'iframe','scripts/audio.js','styles/audio.css','','[\n  {\n    \"name\": \"files\",\n    \"type\": \"audio\",\n    \"importance\": \"high\",\n    \"label\": \"Source files\",\n    \"disableCopyright\": true\n  },\n  {\n    \"name\": \"playerMode\",\n    \"type\": \"select\",\n    \"importance\": \"low\",\n    \"label\": \"Player mode\",\n    \"description\": \"Select the layout of the player.\",\n    \"options\": [\n      {\n        \"value\": \"minimalistic\",\n        \"label\": \"Minimalistic\"\n      },\n      {\n        \"value\": \"full\",\n        \"label\": \"Full\"\n      },\n      {\n        \"value\": \"transparent\",\n        \"label\": \"Transparent\"\n      }\n    ],\n    \"default\": \"minimalistic\"\n  },\n  {\n    \"name\": \"fitToWrapper\",\n    \"type\": \"boolean\",\n    \"importance\": \"low\",\n    \"label\": \"Fit to wrapper\",\n    \"default\": false,\n    \"descriptions\": \"Adjust audioplayer size to use available space\",\n    \"widget\": \"showWhen\",\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"playerMode\",\n          \"equals\": \"minimalistic\"\n        },\n        {\n          \"field\": \"playerMode\",\n          \"equals\": \"full\"\n        }\n      ]\n    }\n  },\n  {\n    \"name\": \"controls\",\n    \"type\": \"boolean\",\n    \"importance\": \"low\",\n    \"label\": \"Enable controls\",\n    \"default\": true,\n    \"description\": \"Controls allow the user to for instance pause the audio\",\n    \"widget\": \"showWhen\",\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"playerMode\",\n          \"equals\": \"full\"\n        }\n      ]\n    }\n  },\n  {\n    \"name\": \"autoplay\",\n    \"type\": \"boolean\",\n    \"importance\": \"low\",\n    \"label\": \"Enable autoplay\",\n    \"description\": \"With autoplay the audio starts to play immediately. Do note that this is not supported by all browsers\"\n  },\n  {\n    \"name\": \"playAud