(23,'H5P.AudioRecorder','Audio Recorder',1,0,33,1,0,'iframe','dist/h5p-audio-recorder.js','fonts/h5p-audio-recorder-font-open-sans.css','','[\n  {\n    \"label\": \"Task Description\",\n    \"importance\": \"high\",\n    \"name\": \"title\",\n    \"type\": \"text\",\n    \"widget\": \"textarea\",\n    \"description\": \"Optional text to display above the audio recorder\",\n    \"optional\": true\n  },\n  {\n    \"label\": \"Localization\",\n    \"name\": \"l10n\",\n    \"type\": \"group\",\n    \"common\": true,\n    \"fields\": [\n      {\n        \"name\": \"recordAnswer\",\n        \"label\": \"Record button text\",\n        \"type\": \"text\",\n        \"default\": \"Record\"\n      },\n      {\n        \"name\": \"pause\",\n        \"label\": \"Pause button text\",\n        \"type\": \"text\",\n        \"default\": \"Pause\"\n      },\n      {\n        \"name\": \"continue\",\n        \"label\": \"Continue button text\",\n        \"type\": \"text\",\n        \"default\": \"Continue\"\n      },\n      {\n        \"name\": \"download\",\n        \"label\": \"Download button text\",\n        \"type\": \"text\",\n        \"default\": \"Download\"\n      },\n      {\n        \"name\": \"done\",\n        \"label\": \"Done button text\",\n        \"type\": \"text\",\n        \"default\": \"Done\"\n      },\n      {\n        \"name\": \"retry\",\n        \"label\": \"Retry button text\",\n        \"type\": \"text\",\n        \"default\": \"Retry\"\n      },\n      {\n        \"name\": \"microphoneNotSupported\",\n        \"label\": \"Microphone not supported error message\",\n        \"type\": \"text\",\n        \"default\": \"Microphone not supported. Make sure you are using a browser that allows microphone recording.\"\n      },\n      {\n        \"name\": \"microphoneInaccessible\",\n        \"label\": \"Microphone inaccessible error message\",\n        \"type\": \"text\",\n        \"default\": \"Microphone is not accessible. Make sure that the browser microphone is