(24,'H5P.Blanks','Fill in the Blanks',1,14,13,1,0,'iframe','js/blanks.js, js/cloze.js','css/blanks.css','','[\n  {\n    \"name\": \"media\",\n    \"type\": \"group\",\n    \"label\": \"Media\",\n    \"importance\": \"medium\",\n    \"fields\": [\n      {\n        \"name\": \"type\",\n        \"type\": \"library\",\n        \"label\": \"Type\",\n        \"options\": [\n          \"H5P.Image 1.1\",\n          \"H5P.Video 1.6\",\n          \"H5P.Audio 1.5\"\n        ],\n        \"optional\": true,\n        \"description\": \"Optional media to display above the question.\"\n      },\n      {\n        \"name\": \"disableImageZooming\",\n        \"type\": \"boolean\",\n        \"label\": \"Disable image zooming\",\n        \"importance\": \"low\",\n        \"default\": false,\n        \"optional\": true,\n        \"widget\": \"showWhen\",\n        \"showWhen\": {\n          \"rules\": [\n            {\n              \"field\": \"type\",\n              \"equals\": \"H5P.Image 1.1\"\n            }\n          ]\n        }\n      }\n    ]\n  },\n  {\n    \"label\": \"Task description\",\n    \"importance\": \"high\",\n    \"name\": \"text\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"default\": \"Fill in the missing words\",\n    \"description\": \"A guide telling the user how to answer this task.\",\n    \"enterMode\": \"p\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"u\",\n      \"a\",\n      \"ul\",\n      \"ol\",\n      \"h2\",\n      \"h3\",\n      \"hr\",\n      \"pre\",\n      \"code\"\n    ]\n  },\n  {\n    \"name\": \"questions\",\n    \"type\": \"list\",\n    \"label\": \"Text blocks\",\n    \"importance\": \"high\",\n    \"entity\": \"text block\",\n    \"min\": 1,\n    \"max\": 31,\n    \"field\": {\n      \"name\": \"question\",\n      \"type\": \"text\",\n      \"widget\": \"html\",\n      \"label\": \"Line of text\",\n      \"importance\": \"high\",\n      \"placeholder\": \"Oslo is the capital of *Norway*.\",\n      \"descripti