false\n      },\n      {\n        \"label\": \"Show confirmation dialog on \\\"Retry\\\"\",\n        \"importance\": \"low\",\n        \"name\": \"confirmRetryDialog\",\n        \"type\": \"boolean\",\n        \"default\": false\n      },\n      {\n        \"name\": \"acceptSpellingErrors\",\n        \"type\": \"boolean\",\n        \"label\": \"Accept minor spelling errors\",\n        \"importance\": \"low\",\n        \"description\": \"If activated, an answer will also count as correct with minor spelling errors (3-9 characters: 1 spelling error, more than 9 characters: 2 spelling errors)\",\n        \"default\": false,\n        \"optional\": true\n      }\n    ]\n  },\n  {\n    \"label\": \"Check confirmation dialog\",\n    \"importance\": \"low\",\n    \"name\": \"confirmCheck\",\n    \"type\": \"group\",\n    \"common\": true,\n    \"fields\": [\n      {\n        \"label\": \"Header text\",\n        \"importance\": \"low\",\n        \"name\": \"header\",\n        \"type\": \"text\",\n        \"default\": \"Finish ?\"\n      },\n      {\n        \"label\": \"Body text\",\n        \"importance\": \"low\",\n        \"name\": \"body\",\n        \"type\": \"text\",\n        \"default\": \"Are you sure you wish to finish ?\",\n        \"widget\": \"html\",\n        \"enterMode\": \"p\",\n        \"tags\": [\n          \"strong\",\n          \"em\",\n          \"del\",\n          \"u\",\n          \"code\"\n        ]\n      },\n      {\n        \"label\": \"Cancel button label\",\n        \"importance\": \"low\",\n        \"name\": \"cancelLabel\",\n        \"type\": \"text\",\n        \"default\": \"Cancel\"\n      },\n      {\n        \"label\": \"Confirm button label\",\n        \"importance\": \"low\",\n        \"name\": \"confirmLabel\",\n        \"type\": \"text\",\n        \"default\": \"Finish\"\n      }\n    ]\n  },\n  {\n    \"label\": \"Retry confirmation dialog\",\n    \"importance\": \"low\",\n    \"name\": \"confirmRetry\",\n    \"type\": \"group\",\n    