(29,'H5P.Dialogcards','Dialog Cards',1,9,18,1,0,'iframe','dist/h5p-dialogcards.js','dist/h5p-dialogcards.css','','[\n  {\n    \"name\": \"title\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"label\": \"Heading\",\n    \"importance\": \"high\",\n    \"optional\": true,\n    \"tags\": [\n      \"p\",\n      \"br\",\n      \"strong\",\n      \"em\",\n      \"code\"\n    ]\n  },\n  {\n    \"name\": \"mode\",\n    \"type\": \"select\",\n    \"label\": \"Mode\",\n    \"description\": \"Mode of presenting the dialog cards\",\n    \"importance\": \"medium\",\n    \"options\": [\n      {\n        \"value\": \"normal\",\n        \"label\": \"Normal\"\n      },\n      {\n        \"value\": \"repetition\",\n        \"label\": \"Repetition\"\n      }\n    ],\n    \"default\": \"normal\"\n  },\n  {\n    \"name\": \"description\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"label\": \"Task description\",\n    \"importance\": \"medium\",\n    \"optional\": true,\n    \"tags\": [\n      \"p\",\n      \"br\",\n      \"strong\",\n      \"em\",\n      \"code\"\n    ]\n  },\n  {\n    \"name\": \"dialogs\",\n    \"type\": \"list\",\n    \"importance\": \"high\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      }\n    ],\n    \"label\": \"Dialogs\",\n    \"entity\": \"dialog\",\n    \"min\": 1,\n    \"defaultNum\": 1,\n    \"field\": {\n      \"name\": \"question\",\n      \"type\": \"group\",\n      \"label\": \"Question\",\n      \"importance\": \"high\",\n      \"fields\": [\n        {\n          \"name\": \"text\",\n          \"type\": \"text\",\n          \"widget\": \"html\",\n          \"tags\": [\n            \"p\",\n            \"br\",\n            \"strong\",\n            \"em\",\n            \"code\"\n          ],\n          \"label\": \"Text\",\n          \"importance\": \"high\",\n          \"description\": \"Hint for the first part of the dialogue\",\n          \"default\": \"<p style=\\\"t