(34,'H5P.DragText','Drag the Words',1,10,17,1,0,'iframe','dist/h5p-drag-text.js','dist/h5p-drag-text.css','','[\n  {\n    \"name\": \"media\",\n    \"type\": \"group\",\n    \"label\": \"Media\",\n    \"importance\": \"medium\",\n    \"fields\": [\n      {\n        \"name\": \"type\",\n        \"type\": \"library\",\n        \"label\": \"Type\",\n        \"importance\": \"medium\",\n        \"options\": [\n          \"H5P.Image 1.1\",\n          \"H5P.Video 1.6\",\n          \"H5P.Audio 1.5\"\n        ],\n        \"optional\": true,\n        \"description\": \"Optional media to display above the question.\"\n      },\n      {\n        \"name\": \"disableImageZooming\",\n        \"type\": \"boolean\",\n        \"label\": \"Disable image zooming\",\n        \"importance\": \"low\",\n        \"default\": false,\n        \"optional\": true,\n        \"widget\": \"showWhen\",\n        \"showWhen\": {\n          \"rules\": [\n            {\n              \"field\": \"type\",\n              \"equals\": \"H5P.Image 1.1\"\n            }\n          ]\n        }\n      }\n    ]\n  },\n  {\n    \"label\": \"Task description\",\n    \"importance\": \"high\",\n    \"name\": \"taskDescription\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"description\": \"Describe how the user should solve the task.\",\n    \"default\": \"Drag the words into the correct boxes\",\n    \"enterMode\": \"p\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"u\",\n      \"a\",\n      \"ul\",\n      \"ol\",\n      \"h2\",\n      \"h3\",\n      \"hr\",\n      \"pre\",\n      \"code\"\n    ]\n  },\n  {\n    \"label\": \"Text\",\n    \"importance\": \"high\",\n    \"name\": \"textField\",\n    \"type\": \"text\",\n    \"widget\": \"textarea\",\n    \"placeholder\": \"*Oslo* is the capital of Norway, *Stockholm* is the capital of Sweden and *Copenhagen* is the capital of Denmark. All cities are located in the *Scandinavian:Northern Part of Europe* peninsula.\",\n    \"description\"