(60,'H5P.ImageHotspots','Image Hotspots',1,10,18,1,1,'iframe','scripts/image-hotspots.js, scripts/hotspot.js, scripts/popup.js','styles/image-hotspots.css','','[\n  {\n    \"label\": \"Background image\",\n    \"importance\": \"high\",\n    \"name\": \"image\",\n    \"type\": \"image\",\n    \"description\": \"Image shown on background.\"\n  },\n  {\n    \"name\": \"backgroundImageAltText\",\n    \"type\": \"text\",\n    \"label\": \"Alternative text for background image\",\n    \"description\": \"If the browser can\'t load the image this text will be displayed instead. Also used by assistive technologies.\",\n    \"optional\": true\n  },\n  {\n    \"name\": \"iconType\",\n    \"type\": \"select\",\n    \"label\": \"Hotspot Icon\",\n    \"options\": [\n      {\n        \"value\": \"icon\",\n        \"label\": \"Predefined icon\"\n      },\n      {\n        \"value\": \"image\",\n        \"label\": \"Uploaded image\"\n      }\n    ],\n    \"default\": \"icon\"\n  },\n  {\n    \"name\": \"icon\",\n    \"type\": \"select\",\n    \"label\": \"Predefined icon\",\n    \"importance\": \"medium\",\n    \"description\": \"Using a predefined icon for the hotspot.\",\n    \"widget\": \"showWhen\",\n    \"showWhen\": {\n      \"rules\": [\n        {\n          \"field\": \"iconType\",\n          \"equals\": [\n            \"icon\"\n          ]\n        }\n      ]\n    },\n    \"options\": [\n      {\n        \"value\": \"plus\",\n        \"label\": \"Plus\"\n      },\n      {\n        \"value\": \"minus\",\n        \"label\": \"Minus\"\n      },\n      {\n        \"value\": \"times\",\n        \"label\": \"Times\"\n      },\n      {\n        \"value\": \"check\",\n        \"label\": \"Check\"\n      },\n      {\n        \"value\": \"question\",\n        \"label\": \"Question\"\n      },\n      {\n        \"value\": \"info\",\n        \"label\": \"Info\"\n      },\n      {\n        \"value\": \"exclamation\",\n        \"label\": \"Exclamation\"\n      }\n    ],\n    \"default\":