(66,'H5P.MemoryGame','Memory Game',1,3,29,1,0,'','memory-game.js, card.js, counter.js, popup.js, timer.js, aria-live-region.js','memory-game.css','','[\n  {\n    \"name\": \"cards\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      }\n    ],\n    \"label\": \"Cards\",\n    \"importance\": \"high\",\n    \"entity\": \"card\",\n    \"min\": 2,\n    \"max\": 100,\n    \"field\": {\n      \"type\": \"group\",\n      \"name\": \"card\",\n      \"label\": \"Card\",\n      \"importance\": \"high\",\n      \"fields\": [\n        {\n          \"name\": \"image\",\n          \"type\": \"image\",\n          \"label\": \"Image\",\n          \"importance\": \"high\",\n          \"ratio\": 1\n        },\n        {\n          \"name\": \"imageAlt\",\n          \"type\": \"text\",\n          \"label\": \"Alternative text for Image\",\n          \"importance\": \"high\",\n          \"description\": \"Describe what can be seen in the photo. The text is read by text-to-speech tools needed by visually impaired users.\"\n        },\n        {\n          \"name\": \"audio\",\n          \"type\": \"audio\",\n          \"importance\": \"high\",\n          \"label\": \"Audio Track\",\n          \"description\": \"An optional sound that plays when the card is turned.\",\n          \"optional\": true,\n          \"widgetExtensions\": [\n            \"AudioRecorder\"\n          ]\n        },\n        {\n          \"name\": \"match\",\n          \"type\": \"image\",\n          \"label\": \"Matching Image\",\n          \"importance\": \"low\",\n          \"optional\": true,\n          \"description\": \"An optional image to match against instead of using two cards with the same image.\",\n          \"ratio\": 1\n        },\n        {\n          \"name\": \"matchAlt\",\n          \"type\": \"text\",\n          \"label\": \"Alternative text for Matching Image\",\n          \"importance\": \"low\",\n          \"optiona