r retrying when the game is over\",\n        \"importance\": \"low\",\n        \"default\": true\n      }\n    ]\n  },\n  {\n    \"name\": \"lookNFeel\",\n    \"type\": \"group\",\n    \"label\": \"Look and feel\",\n    \"importance\": \"low\",\n    \"description\": \"Control the visuals of the game.\",\n    \"optional\": true,\n    \"fields\": [\n      {\n        \"name\": \"themeColor\",\n        \"type\": \"text\",\n        \"label\": \"Theme Color\",\n        \"importance\": \"low\",\n        \"description\": \"Choose a color to create a theme for your card game.\",\n        \"optional\": true,\n        \"default\": \"#707070\",\n        \"widget\": \"colorSelector\",\n        \"spectrum\": {\n          \"showInput\": true\n        }\n      },\n      {\n        \"name\": \"cardBack\",\n        \"type\": \"image\",\n        \"label\": \"Card Back\",\n        \"importance\": \"low\",\n        \"optional\": true,\n        \"description\": \"Use a custom back for your cards.\",\n        \"ratio\": 1\n      }\n    ]\n  },\n  {\n    \"label\": \"Localization\",\n    \"importance\": \"low\",\n    \"name\": \"l10n\",\n    \"type\": \"group\",\n    \"common\": true,\n    \"fields\": [\n      {\n        \"label\": \"Card turns text\",\n        \"importance\": \"low\",\n        \"name\": \"cardTurns\",\n        \"type\": \"text\",\n        \"default\": \"Card turns\"\n      },\n      {\n        \"label\": \"Time spent text\",\n        \"importance\": \"low\",\n        \"name\": \"timeSpent\",\n        \"type\": \"text\",\n        \"default\": \"Time spent\"\n      },\n      {\n        \"label\": \"Feedback text\",\n        \"importance\": \"low\",\n        \"name\": \"feedback\",\n        \"type\": \"text\",\n        \"default\": \"Good work!\"\n      },\n      {\n        \"label\": \"Try again button text\",\n        \"importance\": \"low\",\n        \"name\": \"tryAgain\",\n        \"type\": \"text\",\n        \"default\": \"Reset\"\n      },\n      {\n        \"label\": \"Close button label\",\n        \"importance\": \"low\",\n        \"name\": \"closeLabel\",\n        \"type\": \"text\",\n        \"default\": \"Close\"\n      },\n      {\n        \"label\": \"Game label\",\n        \"importance\": \"low\",\n        \"name\": \"label\",\n        \"type\": \"text\",\n        \"default\": \"Memory Game. Find the matching cards.\"\n      },\n      {\n        \"label\": \"Game instructions\",\n        \"importance\": \"low\",\n        \"name\": \"label\",\n        \"type\": \"text\",\n        \"default\": \"Use arrow keys left and right to navigate cards. Use space or enter key to turn card.\"\n      },\n      {\n        \"label\": \"Game finished label\",\n        \"importance\": \"low\",\n        \"name\": \"done\",\n        \"type\": \"text\",\n        \"default\": \"All of the cards have been found.\"\n      },\n      {\n        \"label\": \"Card indexing label\",\n        \"description\": \"%num and %total are placeholders and will be replaced with the respective values for the card.\",\n        \"importance\": \"low\",\n        \"name\": \"cardPrefix\",\n        \"type\": \"text\",\n        \"default\": \"Card %num of %total:\"\n      },\n      {\n        \"label\": \"Card unturned label\",\n        \"importance\": \"low\",\n        \"name\": \"cardUnturned\",\n        \"type\": \"text\",\n        \"default\": \"Unturned. Click to turn.\"\n      },\n      {\n        \"label\": \"Card turned label\",\n        \"importance\": \"low\",\n        \"name\": \"cardTurned\",\n        \"type\": \"text\",\n        \"default\": \"Turned.\"\n      },\n      {\n        \"label\": \"Card matched label\",\n        \"importance\": \"low\",\n        \"name\": \"cardMatched\",\n        \"type\": \"text\",\n        \"default\": \"Match found.\"\n      },\n      {\n        \"label\": \"Card matched announcement\",\n        \"importance\": \"low\",\n        \"name\": \"cardMatchedA11y\",\n        \"type\": \"text\",\n        \"default\": \"Your cards match!\"\n      },\n      {\n        \"label\": \"Card not matched announcement\",\n        \"importance\": \"low\",\n        \"name\": \"cardNotMatchedA11y\",\n        \"type\": \"text\",\n        \"default\": \"Your chosen cards do not match. Turn other cards to try again.\"\n      }\n    ]\n  }\n]\n',NULL,NULL,NULL,NULL,NULL,NULL,1),
(67,'H5P.MultiChoice','Multiple Choice',1,16,14,1,0,'iframe','js/multichoice.js','css/multichoice.css','','[\n  {\n    \"name\": \"media\",\n    \"type\": \"group\",\n    \"label\": \"Media\",\n    \"importance\": \"medium\",\n    \"fields\": [\n      {\n        \"name\": \"type\",\n        \"type\": \"library\",\n        \"label\": \"Type\",\n        \"importance\": \"medium\",\n        \"options\": [\n          \"H5P.Image 1.1\",\n          \"H5P.Video 1.6\",\n          \"H5P.Audio 1.5\"\n        ],\n        \"optional\": true,\n        \"description\": \"Optional media to display above the question.\"\n      },\n      {\n        \"name\": \"disableImageZooming\",\n        \"type\": \"boolean\",\n        \"label\": \"Disable image zooming\",\n        \"importance\": \"low\",\n        \"default\": false,\n        \"optional\": true,\n        \"widget\": \"showWhen\",\n        \"showWhen\": {\n          \"rules\": [\n            {\n              \"field\": \"type\",\n              \"equals\": \"H5P.Image 1.1\"\n            }\n          ]\n        }\n      }\n    ]\n  },\n  {\n    \"name\": \"question\",\n    \"type\": \"text\",\n    \"importance\": \"medium\",\n    \"widget\": \"html\",\n    \"label\": \"Question\",\n    \"enterMode\": \"p\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"sub\",\n      \"sup\",\n      \"h2\",\n      \"h3\",\n      \"pre\",\n      \"code\"\n    ]\n  },\n  {\n    \"name\": \"answers\",\n    \"type\": \"list\",\n    \"importance\": \"high\",\n    \"label\": \"Available options\",\n    \"entity\": \"option\",\n    \"min\": 1,\n    \"defaultNum\": 2,\n    \"field\": {\n      \"name\": \"answer\",\n      \"type\": \"group\",\n      \"label\": \"Option\",\n      \"importance\": \"high\",\n      \"fields\": [\n        {\n          \"name\": \"text\",\n          \"type\": \"text\",\n          \"importance\": \"medium\",\n          \"widget\": \"html\",\n          \"label\": \"Text\",\n          \"tags\": [\n            \"strong\