(72,'H5P.Questionnaire','Questionnaire',1,3,11,1,0,'iframe','dist/dist.js','dist/styles.css','','[\n  {\n    \"name\": \"questionnaireElements\",\n    \"label\": \"Questionnaire elements\",\n    \"importance\": \"high\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\",\n        \"importance\": \"high\"\n      }\n    ],\n    \"entity\": \"element\",\n    \"min\": 1,\n    \"defaultNum\": 1,\n    \"field\": {\n      \"name\": \"libraryGroup\",\n      \"label\": \"Choose library\",\n      \"importance\": \"high\",\n      \"type\": \"group\",\n      \"fields\": [\n        {\n          \"name\": \"library\",\n          \"type\": \"library\",\n          \"label\": \"Library\",\n          \"importance\": \"high\",\n          \"description\": \"Choose a library\",\n          \"options\": [\n            \"H5P.OpenEndedQuestion 1.0\",\n            \"H5P.SimpleMultiChoice 1.1\"\n          ]\n        },\n        {\n          \"name\": \"requiredField\",\n          \"type\": \"boolean\",\n          \"label\": \"Required field\",\n          \"importance\": \"low\",\n          \"default\": false\n        }\n      ]\n    }\n  },\n  {\n    \"name\": \"successScreenOptions\",\n    \"label\": \"Success screen options\",\n    \"importance\": \"low\",\n    \"type\": \"group\",\n    \"fields\": [\n      {\n        \"name\": \"enableSuccessScreen\",\n        \"label\": \"Enable success screen\",\n        \"importance\": \"low\",\n        \"type\": \"boolean\",\n        \"default\": true\n      },\n      {\n        \"name\": \"successScreenImage\",\n        \"label\": \"Add success screen image\",\n        \"importance\": \"low\",\n        \"type\": \"group\",\n        \"fields\": [\n          {\n            \"name\": \"successScreenImage\",\n            \"label\": \"Replace success icon with image\",\n            \"importance\": \"low\",\n            \"type\": \"library\",\n            \"optional\": true,\n         