(73,'H5P.QuestionSet','Question Set',1,20,31,1,0,'iframe','js/questionset.js','css/questionset.css','','[\n  {\n    \"name\": \"introPage\",\n    \"type\": \"group\",\n    \"label\": \"Quiz introduction\",\n    \"importance\": \"medium\",\n    \"fields\": [\n      {\n        \"name\": \"showIntroPage\",\n        \"type\": \"boolean\",\n        \"label\": \"Display introduction\",\n        \"importance\": \"low\"\n      },\n      {\n        \"name\": \"title\",\n        \"type\": \"text\",\n        \"label\": \"Title\",\n        \"importance\": \"high\",\n        \"optional\": true,\n        \"description\": \"This title will be displayed above the introduction text.\",\n        \"tags\": [\n          \"sub\",\n          \"sup\",\n          \"strong\",\n          \"em\",\n          \"code\"\n        ]\n      },\n      {\n        \"name\": \"introduction\",\n        \"type\": \"text\",\n        \"widget\": \"html\",\n        \"label\": \"Introduction text\",\n        \"importance\": \"medium\",\n        \"optional\": true,\n        \"description\": \"This text will be displayed before the quiz starts.\",\n        \"enterMode\": \"p\",\n        \"tags\": [\n          \"sub\",\n          \"sup\",\n          \"strong\",\n          \"em\",\n          \"p\",\n          \"code\"\n        ]\n      },\n      {\n        \"name\": \"startButtonText\",\n        \"type\": \"text\",\n        \"label\": \"Start button text\",\n        \"importance\": \"low\",\n        \"optional\": true,\n        \"default\": \"Start Quiz\"\n      },\n      {\n        \"name\": \"backgroundImage\",\n        \"type\": \"image\",\n        \"label\": \"Background image\",\n        \"importance\": \"low\",\n        \"optional\": true,\n        \"description\": \"An optional background image for the introduction.\"\n      }\n    ]\n  },\n  {\n    \"name\": \"backgroundImage\",\n    \"type\": \"image\",\n    \"label\": \"Background image\",\n    \"importance\": \"low\",\n    \"optional\": true,\n    \"description\": \"An optional background image for the Question set.\"\n  },\n  {\n    \"name\": \"progressType\",\n    \"type\": \"select\",\n    \"label\": \"Progress indicator\",\n    \"importance\": \"low\",\n    \"description\": \"Question set progress indicator style.\",\n    \"options\": [\n      {\n        \"value\": \"textual\",\n        \"label\": \"Textual\"\n      },\n      {\n        \"value\": \"dots\",\n        \"label\": \"Dots\"\n      }\n    ],\n    \"default\": \"dots\"\n  },\n  {\n    \"name\": \"passPercentage\",\n    \"type\": \"number\",\n    \"label\": \"Pass percentage\",\n    \"importance\": \"low\",\n    \"description\": \"Percentage of Total score required for passing the quiz.\",\n    \"min\": 0,\n    \"max\": 100,\n    \"step\": 1,\n    \"default\": 50\n  },\n  {\n    \"name\": \"questions\",\n    \"label\": \"Questions\",\n    \"importance\": \"high\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      },\n      {\n        \"name\": \"QuestionSetTextualEditor\",\n        \"label\": \"Textual\"\n      }\n    ],\n    \"min\": 1,\n    \"entity\": \"question\",\n    \"field\": {\n      \"name\": \"question\",\n      \"type\": \"library\",\n      \"label\": \"Question type\",\n      \"importance\": \"high\",\n      \"description\": \"Library for this question.\",\n      \"options\": [\n        \"H5P.MultiChoice 1.16\",\n        \"H5P.DragQuestion 1.14\",\n        \"H5P.Blanks 1.14\",\n        \"H5P.MarkTheWords 1.11\",\n        \"H5P.DragText 1.10\",\n        \"H5P.TrueFalse 1.8\",\n        \"H5P.Essay 1.5\",\n        \"H5P.MultiMediaChoice 0.3\"\n      ]\n    }\n  },\n  {\n    \"name\": \"texts\",\n    \"type\": \"group\",\n    \"label\": \"Interface texts in quiz\",\n    \"importance\": \"low\",\n    \"common\": true,\n    \"fields\": [\n      {\n        \"name\": \"prevButton\",\n        \"type\": \"text\",\n        \"label\": \"Back button\",\n        \"importance\": \"low\",\n        \"default\": \"Previous question\"\n      },\n      {\n        \"name\": \"nextButton\",\n        \"type\": \"text\",\n        \"label\": \"Next button\",\n        \"importance\": \"low\",\n        \"default\": \"Next question\"\n      },\n      {\n        \"name\": \"finishButton\",\n        \"type\": \"text\",\n        \"label\": \"Finish button\",\n        \"importance\": \"low\",\n        \"default\": \"Finish\"\n      },\n      {\n        \"name\": \"submitButton\",\n        \"type\": \"text\",\n        \"label\": \"Submit button\",\n        \"importance\": \"low\",\n        \"default\": \"Submit\"\n      },\n      {\n        \"name\": \"textualProgress\",\n        \"type\": \"text\",\n        \"label\": \"Progress text\",\n        \"importance\": \"low\",\n        \"description\": \"Text used if textual progress is selected.\",\n        \"default\": \"Question: @current of @total questions\",\n        \"tags\": [\n          \"strong\",\n          \"em\",\n          \"code\"\n        ]\n      },\n      {\n        \"name\": \"jumpToQuestion\",\n        \"type\": \"text\",\n        \"label\": \"Label for jumping to a certain question\",\n        \"importance\": \"low\",\n        \"description\": \"You must use the placeholder \'%d\' instead of the question number, and %total instead of total amount of questions.\",\n        \"default\": \"Question %d of %total\"\n      },\n      {\n        \"name\": \"questionLabel\",\n        \"type\": \"text\",\n        \"label\": \"Copyright dialog question label\",\n        \"importance\": \"low\",\n        \"default\": \"Question\"\n      },\n      {\n        \"name\": \"readSpeakerProgress\",\n        \"type\": \"text\",\n        \"label\": \"Readspeaker progress\",\n        \"importance\": \"low\",\n        \"description\": \"May use @current and @total question variables\",\n        \"default\": \"Question @current of @total\"\n      },\n      {\n        \"name\": \"unansweredText\",\n        \"type\": \"text\",\n        \"label\": \"Unanswered question text\",\n        \"importance\": \"low\",\n        \"default\": \"Unanswered\"\n      },\n      {\n        \"name\": \"answeredText\",\n        \"type\": \"text\",\n        \"label\": \"Answered question text\",\n        \"importance\": \"low\",\n        \"default\": \"Answered\"\n      },\n      {\n        \"name\": \"currentQuestionText\",\n        \"type\": \"text\",\n        \"label\": \"Current question text\",\n        \"importance\": \"low\",\n        \"default\": \"Current question\"\n      },\n      {\n        \"name\": \"navigationLabel\",\n        \"type\": \"text\",\n        \"label\": \"Navigation label for readspeakers\",\n        \"importance\": \"low\",\n        \"default\": \"Questions\"\n      },\n      {\n        \"name\": \"questionSetInstruction\",\n        \"type\": \"text\",\n        \"label\": \"Instruction for navigating question set with screenreader\",\n        \"importance\": \"low\",\n        \"default\": \"Choose question to display\",\n        \"state\": \"new\"\n      }\n    ]\n  },\n  {\n    \"name\": \"disableBackwardsNavigation\",\n    \"type\": \"boolean\",\n    \"label\": \"Disable backwards navigation\",\n    \"importance\": \"low\",\n    \"description\": \"This option will only allow you to move forward in Question Set\",\n    \"optional\": true,\n    \"default\": false\n  },\n  {\n    \"name\": \"randomQuestions\",\n    \"type\": \"boolean\",\n    \"label\": \"Randomize questions\",\n    \"importance\": \"low\",\n    \"description\": \"Enable to randomize the order of questions on display.\",\n    \"default\": false\n  },\n  {\n    \"name\": \"poolSize\",\n    \"type\": \"number\",\n    \"min\": 1,\n    \"label\": \"Number of questions to be shown:\",\n    \"importance\": \"low\",\n    \"description\": \"Create a randomized batch of questions from the total.\",\n    \"optional\": true\n  },\n  {\n    \"name\": \"endGame\",\n    \"type\": \"group\",\n    \"label\": \"Quiz