ed greeting\",\n            \"importance\": \"low\",\n            \"optional\": true,\n            \"description\": \"This text will be displayed above the score if the user has successfully passed the quiz.\",\n            \"tags\": [\n              \"strong\",\n              \"em\",\n              \"code\"\n            ]\n          },\n          {\n            \"name\": \"successComment\",\n            \"type\": \"text\",\n            \"widget\": \"html\",\n            \"label\": \"Passed comment\",\n            \"importance\": \"low\",\n            \"optional\": true,\n            \"description\": \"This comment will be displayed after the score if the user has successfully passed the quiz.\",\n            \"tags\": [\n              \"sub\",\n              \"sup\",\n              \"strong\",\n              \"em\",\n              \"a\",\n              \"p\",\n              \"code\"\n            ]\n          },\n          {\n            \"name\": \"failGreeting\",\n            \"type\": \"text\",\n            \"label\": \"Quiz failed title\",\n            \"importance\": \"low\",\n            \"optional\": true,\n            \"description\": \"This text will be displayed above the score if the user has failed the quiz.\",\n            \"tags\": [\n              \"strong\",\n              \"em\",\n              \"code\"\n            ]\n          },\n          {\n            \"name\": \"failComment\",\n            \"type\": \"text\",\n            \"widget\": \"html\",\n            \"label\": \"Failed comment\",\n            \"importance\": \"low\",\n            \"optional\": true,\n            \"description\": \"This comment will be displayed after the score if the user has failed the quiz.\",\n            \"tags\": [\n              \"sub\",\n              \"sup\",\n              \"strong\",\n              \"em\",\n              \"a\",\n              \"p\",\n              \"code\"\n            ]\n          }\n        ]\n      },\n      {\n        \"name\": \"solutionButtonText\",\n        \"type\": \"text\",\n        \"label\": \"Solution button label\",\n        \"importance\": \"low\",\n        \"default\": \"Show solution\",\n        \"description\": \"Text for the solution button.\"\n      },\n      {\n        \"name\": \"retryButtonText\",\n        \"type\": \"text\",\n        \"label\": \"Retry button label\",\n        \"importance\": \"low\",\n        \"default\": \"Retry\",\n        \"description\": \"Text for the retry button.\"\n      },\n      {\n        \"name\": \"finishButtonText\",\n        \"type\": \"text\",\n        \"label\": \"Finish button text\",\n        \"importance\": \"low\",\n        \"default\": \"Finish\"\n      },\n      {\n        \"name\": \"submitButtonText\",\n        \"type\": \"text\",\n        \"label\": \"Submit button text\",\n        \"importance\": \"low\",\n        \"default\": \"Submit\"\n      },\n      {\n        \"name\": \"showAnimations\",\n        \"type\": \"boolean\",\n        \"label\": \"Display video before quiz results\",\n        \"importance\": \"low\"\n      },\n      {\n        \"name\": \"skippable\",\n        \"type\": \"boolean\",\n        \"label\": \"Enable skip video button\",\n        \"importance\": \"low\"\n      },\n      {\n        \"name\": \"skipButtonText\",\n        \"type\": \"text\",\n        \"label\": \"Skip video button label\",\n        \"importance\": \"low\",\n        \"default\": \"Skip video\"\n      },\n      {\n        \"name\": \"successVideo\",\n        \"type\": \"video\",\n        \"label\": \"Passed video\",\n        \"importance\": \"low\",\n        \"optional\": true,\n        \"description\": \"This video will be played if the user successfully passed the quiz.\"\n      },\n      {\n        \"name\": \"failVideo\",\n        \"type\": \"video\",\n        \"label\": \"Fail video\",\n        \"importance\": \"low\",\n        \"optional\": true,\n        \"description\": \"This video will be played if the user fails the quiz.\"\n      }\n    ]\n  },\n  {\n    \"name\": \"override\",\n    \"type\": \"group\",\n    \"label\": \"Settings for \\\"Check\\\", \\\"Show solution\\\" and \\\"Retry\\\"\",\n    \"importance\": \"low\",\n    \"optional\": true,\n    \"fields\": [\n      {\n        \"name\": \"checkButton\",\n        \"type\": \"boolean\",\n        \"label\": \"Show \\\"Check\\\" buttons\",\n        \"importance\": \"low\",\n        \"description\": \"This option determines if the \\\"Check\\\" button will be shown for all questions.\",\n        \"optional\": true,\n        \"default\": true\n      },\n      {\n        \"name\": \"showSolutionButton\",\n        \"type\": \"select\",\n        \"label\": \"Override \\\"Show Solution\\\" button\",\n        \"importance\": \"low\",\n        \"description\": \"This option determines if the \\\"Show Solution\\\" button will be shown for all questions, disabled for all or configured for each question individually.\",\n        \"optional\": true,\n        \"widget\": \"showWhen\",\n        \"showWhen\": {\n          \"rules\": [\n            {\n              \"field\": \"checkButton\",\n              \"equals\": true\n            }\n          ]\n        },\n        \"options\": [\n          {\n            \"value\": \"on\",\n            \"label\": \"Enabled\"\n          },\n          {\n            \"value\": \"off\",\n            \"label\": \"Disabled\"\n          }\n        ]\n      },\n      {\n        \"name\": \"retryButton\",\n        \"type\": \"select\",\n        \"label\": \"Override \\\"Retry\\\" button\",\n        \"importance\": \"low\",\n        \"description\": \"This option determines if the \\\"Retry\\\" button will be shown for all questions, disabled for all or configured for each question individually.\",\n        \"optional\": true,\n        \"widget\": \"showWhen\",\n        \"showWhen\": {\n          \"rules\": [\n            {\n              \"field\": \"checkButton\",\n              \"equals\": true\n            }\n          ]\n  