(97,'H5P.ImageJuxtaposition','Image Juxtaposition',1,5,4,1,1,'iframe','dist/h5p-image-juxtaposition.js','dist/h5p-image-juxtaposition.css','','[\n  {\n    \"name\": \"taskDescription\",\n    \"label\": \"Task description\",\n    \"importance\": \"high\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"description\": \"Put the heading/instructions you\'d like to show above the before/after image here.\",\n    \"placeholder\": \"Here you can add an optional heading and/or instructions.\",\n    \"enterMode\": \"div\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"u\",\n      \"a\",\n      \"ul\",\n      \"ol\",\n      \"h2\",\n      \"h3\",\n      \"hr\",\n      \"pre\",\n      \"code\"\n    ],\n    \"optional\": true\n  },\n  {\n    \"name\": \"imageBefore\",\n    \"type\": \"group\",\n    \"label\": \"First image\",\n    \"importance\": \"high\",\n    \"expanded\": true,\n    \"fields\": [\n      {\n        \"name\": \"imageBefore\",\n        \"label\": \"First image\",\n        \"importance\": \"low\",\n        \"type\": \"library\",\n        \"options\": [\n          \"H5P.Image 1.1\"\n        ],\n        \"optional\": false,\n        \"description\": \"The first image. Please make sure that it has the same size as the second image.\"\n      },\n      {\n        \"name\": \"labelBefore\",\n        \"label\": \"Label for first image\",\n        \"importance\": \"low\",\n        \"type\": \"text\",\n        \"optional\": true,\n        \"description\": \"Label to put over first image\"\n      }\n    ]\n  },\n  {\n    \"name\": \"imageAfter\",\n    \"type\": \"group\",\n    \"label\": \"Second image\",\n    \"importance\": \"high\",\n    \"expanded\": true,\n    \"fields\": [\n      {\n        \"name\": \"imageAfter\",\n        \"label\": \"Second image\",\n        \"importance\": \"low\",\n        \"type\": \"library\",\n        \"options\": [\n          \"H5P.Image 1.1\"\n        ],\n        \"optional\": false,\n        \"description\": \"T