default, line breaks will be replaced with a space character. If you want to check for line breaks, e.g. in regular expressions, you can set a different replacement here.\",\n        \"options\": [\n          {\n            \"value\": \" \",\n            \"label\": \"space\"\n          },\n          {\n            \"value\": \"\\n\",\n            \"label\": \"line break (\\\\n)\"\n          }\n        ],\n        \"default\": \" \"\n      }\n    ]\n  },\n  {\n    \"name\": \"checkAnswer\",\n    \"type\": \"text\",\n    \"label\": \"Text for \\\"Check\\\" button\",\n    \"importance\": \"low\",\n    \"default\": \"Check\",\n    \"common\": true\n  },\n  {\n    \"name\": \"submitAnswer\",\n    \"type\": \"text\",\n    \"label\": \"Text for \\\"Submit\\\" button\",\n    \"importance\": \"low\",\n    \"default\": \"Submit\",\n    \"common\": true\n  },\n  {\n    \"name\": \"tryAgain\",\n    \"label\": \"Text for \\\"Retry\\\" button\",\n    \"type\": \"text\",\n    \"importance\": \"low\",\n    \"default\": \"Retry\",\n    \"common\": true\n  },\n  {\n    \"name\": \"showSolution\",\n    \"type\": \"text\",\n    \"label\": \"Text for \\\"Show solution\\\" button\",\n    \"importance\": \"low\",\n    \"default\": \"Show solution\",\n    \"common\": true\n  },\n  {\n    \"name\": \"feedbackHeader\",\n    \"type\": \"text\",\n    \"label\": \"Header for panel containing feedback for included/missing keywords\",\n    \"importance\": \"low\",\n    \"default\": \"Feedback\",\n    \"common\": true\n  },\n  {\n    \"name\": \"solutionTitle\",\n    \"type\": \"text\",\n    \"label\": \"Label for solution\",\n    \"importance\": \"low\",\n    \"default\": \"Sample solution\",\n    \"common\": true\n  },\n  {\n    \"name\": \"remainingChars\",\n    \"type\": \"text\",\n    \"label\": \"Remaining characters\",\n    \"importance\": \"low\",\n    \"common\": true,\n    \"default\": \"Remaining characters: @chars\",\n    \"description\": \"Message for remaining characters. You can use