(108,'H5P.ImagePair','Image Pair',1,4,0,1,0,'iframe','h5p-image-pair.js, h5p-image-pair-card.js','h5p-image-pair.css','','[\n  {\n    \"label\": \"Task Description\",\n    \"name\": \"taskDescription\",\n    \"type\": \"text\",\n    \"default\": \"Drag images from the left to match them with corresponding images on the right\",\n    \"description\": \"A guide telling the user how to solve this task.\",\n    \"importance\": \"high\"\n  },\n  {\n    \"name\": \"cards\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      }\n    ],\n    \"label\": \"Cards\",\n    \"importance\": \"high\",\n    \"entity\": \"card\",\n    \"min\": 2,\n    \"max\": 100,\n    \"field\": {\n      \"type\": \"group\",\n      \"name\": \"card\",\n      \"label\": \"Card\",\n      \"importance\": \"high\",\n      \"fields\": [\n        {\n          \"name\": \"image\",\n          \"type\": \"image\",\n          \"label\": \"Image\",\n          \"importance\": \"high\",\n          \"ratio\": 1\n        },\n        {\n          \"name\": \"imageAlt\",\n          \"type\": \"text\",\n          \"label\": \"Alternative text for Image\",\n          \"importance\": \"high\",\n          \"description\": \"Describe what can be seen in the photo. The text is read by text-to-speech tools needed by visually impaired users.\"\n        },\n        {\n          \"name\": \"match\",\n          \"type\": \"image\",\n          \"label\": \"Matching Image\",\n          \"importance\": \"low\",\n          \"optional\": true,\n          \"description\": \"An optional image to match against instead of using two cards with the same image.\",\n          \"ratio\": 1\n        },\n        {\n          \"name\": \"matchAlt\",\n          \"type\": \"text\",\n          \"label\": \"Alternative text for Matching Image\",\n          \"importance\": \"low\",\n          \"optional\": true,\n          \"description\": \"Describe what can be seen in 