(109,'H5P.Dictation','Dictation',1,3,3,1,0,'iframe','dist/h5p-dictation.js','dist/h5p-dictation.css','','[\n  {\n    \"name\": \"media\",\n    \"type\": \"group\",\n    \"label\": \"Media\",\n    \"importance\": \"medium\",\n    \"fields\": [\n      {\n        \"name\": \"type\",\n        \"type\": \"library\",\n        \"label\": \"Type\",\n        \"importance\": \"medium\",\n        \"options\": [\n          \"H5P.Image 1.1\",\n          \"H5P.Video 1.6\",\n          \"H5P.Audio 1.5\"\n        ],\n        \"optional\": true,\n        \"description\": \"Optional media to display above the question.\"\n      },\n      {\n        \"name\": \"disableImageZooming\",\n        \"type\": \"boolean\",\n        \"label\": \"Disable image zooming\",\n        \"importance\": \"low\",\n        \"default\": false,\n        \"optional\": true,\n        \"widget\": \"showWhen\",\n        \"showWhen\": {\n          \"rules\": [\n            {\n              \"field\": \"type\",\n              \"equals\": \"H5P.Image 1.1\"\n            }\n          ]\n        }\n      }\n    ]\n  },\n  {\n    \"name\": \"taskDescription\",\n    \"label\": \"Task description\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"importance\": \"high\",\n    \"description\": \"Describe your task here.\",\n    \"placeholder\": \"Please listen carefully and write what you hear.\",\n    \"enterMode\": \"div\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"u\",\n      \"a\",\n      \"ul\",\n      \"ol\",\n      \"h2\",\n      \"h3\",\n      \"hr\",\n      \"pre\",\n      \"code\"\n    ]\n  },\n  {\n    \"name\": \"sentences\",\n    \"label\": \"Sentences\",\n    \"importance\": \"high\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      }\n    ],\n    \"min\": 1,\n    \"entity\": \"Sentence\",\n    \"field\": {\n      \"name\": \"sentence\",\n      \"type\": \"group\",\n      \"label\": \"Sentence\",\n  