text\",\n        \"label\": \"Exclamation point\",\n        \"importance\": \"low\",\n        \"default\": \"exclamation point\"\n      },\n      {\n        \"name\": \"questionMark\",\n        \"type\": \"text\",\n        \"label\": \"Question mark\",\n        \"importance\": \"low\",\n        \"default\": \"question mark\"\n      },\n      {\n        \"name\": \"comma\",\n        \"type\": \"text\",\n        \"label\": \"Comma\",\n        \"importance\": \"low\",\n        \"default\": \"comma\"\n      },\n      {\n        \"name\": \"singleQuote\",\n        \"type\": \"text\",\n        \"label\": \"Single quote\",\n        \"importance\": \"low\",\n        \"default\": \"single quote\"\n      },\n      {\n        \"name\": \"doubleQuote\",\n        \"type\": \"text\",\n        \"label\": \"Double quote\",\n        \"importance\": \"low\",\n        \"default\": \"double quote\"\n      },\n      {\n        \"name\": \"colon\",\n        \"type\": \"text\",\n        \"label\": \"Colon\",\n        \"importance\": \"low\",\n        \"default\": \"colon\"\n      },\n      {\n        \"name\": \"semicolon\",\n        \"type\": \"text\",\n        \"label\": \"Semicolon\",\n        \"importance\": \"low\",\n        \"default\": \"semicolon\"\n      },\n      {\n        \"name\": \"plus\",\n        \"type\": \"text\",\n        \"label\": \"Plus\",\n        \"importance\": \"low\",\n        \"default\": \"plus\"\n      },\n      {\n        \"name\": \"minus\",\n        \"type\": \"text\",\n        \"label\": \"Minus\",\n        \"importance\": \"low\",\n        \"default\": \"minus\"\n      },\n      {\n        \"name\": \"asterisk\",\n        \"type\": \"text\",\n        \"label\": \"Asterisk\",\n        \"importance\": \"low\",\n        \"default\": \"asterisk\"\n      },\n      {\n        \"name\": \"forwardSlash\",\n        \"type\": \"text\",\n        \"label\": \"Forward slash\",\n        \"importance\": \"low\",\n        \"default\": \"forward slash\"\n      }\n    ]\n