(110,'H5P.BranchingQuestion','Branching Question',1,0,20,0,0,'','branchingQuestion.js','branchingQuestion.css','','[\n  {\n    \"name\": \"branchingQuestion\",\n    \"type\": \"group\",\n    \"widget\": \"branchingQuestion\",\n    \"label\": \"Branching Question Editor\",\n    \"importance\": \"high\",\n    \"fields\": [\n      {\n        \"name\": \"question\",\n        \"type\": \"text\",\n        \"importance\": \"medium\",\n        \"widget\": \"html\",\n        \"label\": \"Question\",\n        \"enterMode\": \"p\",\n        \"optional\": true,\n        \"tags\": [\n          \"strong\",\n          \"em\",\n          \"sub\",\n          \"sup\",\n          \"h2\",\n          \"h3\",\n          \"pre\",\n          \"code\"\n        ]\n      },\n      {\n        \"name\": \"alternatives\",\n        \"type\": \"list\",\n        \"importance\": \"high\",\n        \"label\": \"Available alternatives\",\n        \"entity\": \"alternative\",\n        \"min\": 2,\n        \"defaultNum\": 2,\n        \"field\": {\n          \"name\": \"answer\",\n          \"type\": \"group\",\n          \"label\": \"Alternative\",\n          \"importance\": \"high\",\n          \"fields\": [\n            {\n              \"name\": \"text\",\n              \"type\": \"text\",\n              \"importance\": \"medium\",\n              \"label\": \"Text\"\n            },\n            {\n              \"name\": \"nextContentId\",\n              \"type\": \"number\",\n              \"label\": \"Next Content ID (end screens are defined by negative numbers)\",\n              \"importance\": \"high\",\n              \"default\": -1\n            },\n            {\n              \"name\": \"feedback\",\n              \"type\": \"group\",\n              \"label\": \"Feedback\",\n              \"expanded\": true,\n              \"fields\": [\n                {\n                  \"name\": \"title\",\n                  \"type\": \"text\",\n                  \"label\": \"Feedback title\",\n          