(111,'H5P.BranchingScenario','Branching Scenario',1,8,14,1,0,'iframe','dist/h5p-branching-scenario.js','dist/h5p-branching-scenario.css','','[\n  {\n    \"name\": \"branchingScenario\",\n    \"type\": \"group\",\n    \"widget\": \"branchingScenario\",\n    \"label\": \"Branching Scenario Editor\",\n    \"importance\": \"high\",\n    \"fields\": [\n      {\n        \"name\": \"title\",\n        \"label\": \"Title\",\n        \"type\": \"text\",\n        \"importance\": \"high\"\n      },\n      {\n        \"name\": \"startScreen\",\n        \"label\": \"Start screen\",\n        \"type\": \"group\",\n        \"importance\": \"low\",\n        \"fields\": [\n          {\n            \"name\": \"startScreenTitle\",\n            \"label\": \"Course Title\",\n            \"placeholder\": \"Title for your course\",\n            \"type\": \"text\",\n            \"importance\": \"medium\",\n            \"optional\": true,\n            \"widget\": \"html\",\n            \"enterMode\": \"p\",\n            \"tags\": [\n              \"strong\",\n              \"em\",\n              \"del\",\n              \"code\",\n              \"a\"\n            ]\n          },\n          {\n            \"name\": \"startScreenSubtitle\",\n            \"label\": \"Course Details\",\n            \"placeholder\": \"Details about the course\",\n            \"type\": \"text\",\n            \"importance\": \"medium\",\n            \"optional\": true,\n            \"widget\": \"html\",\n            \"enterMode\": \"p\",\n            \"tags\": [\n              \"strong\",\n              \"em\",\n              \"del\",\n              \"code\",\n              \"a\"\n            ]\n          },\n          {\n            \"name\": \"startScreenImage\",\n            \"label\": \"Course image\",\n            \"type\": \"image\",\n            \"optional\": true,\n            \"importance\": \"medium\"\n          },\n          {\n            \"name\": \"startScreenAltText\",\n            \"label\": \"Image a