": \"Override the individual settings for requiring the content to be finished before activating the \\\"Proceed\\\" button. Will not have any effect if the content doesn\'t indicate if it was \\\"finished\\\", e.g. images or course presentations with just one slide.\",\n              \"optional\": \"true\",\n              \"options\": [\n                {\n                  \"value\": \"useBehavioural\",\n                  \"label\": \"Use behavioural setting\"\n                },\n                {\n                  \"value\": \"enabled\",\n                  \"label\": \"Enabled\"\n                },\n                {\n                  \"value\": \"disabled\",\n                  \"label\": \"Disabled\"\n                }\n              ],\n              \"default\": \"useBehavioural\"\n            },\n            {\n              \"name\": \"nextContentId\",\n              \"type\": \"number\",\n              \"importance\": \"high\",\n              \"widget\": \"none\"\n            },\n            {\n              \"name\": \"feedback\",\n              \"type\": \"group\",\n              \"label\": \"Feedback\",\n              \"expanded\": true,\n              \"fields\": [\n                {\n                  \"name\": \"title\",\n                  \"type\": \"text\",\n                  \"label\": \"Feedback title\",\n                  \"optional\": true,\n                  \"widget\": \"html\",\n                  \"enterMode\": \"p\",\n                  \"tags\": [\n                    \"strong\",\n                    \"em\",\n                    \"del\",\n                    \"code\",\n                    \"a\"\n                  ]\n                },\n                {\n                  \"name\": \"subtitle\",\n                  \"type\": \"text\",\n                  \"label\": \"Feedback text\",\n                  \"optional\": true,\n                  \"widget\": \"html\",\n                  \"enterMode\": \"p\",\n                  \"tags\": [\n      