(126,'H5P.AdventCalendar','Advent Calendar (beta)',0,3,4,1,0,'iframe','dist/h5p-advent-calendar.js','dist/h5p-advent-calendar.css','','[\n  {\n    \"name\": \"modeDoorImage\",\n    \"type\": \"select\",\n    \"label\": \"Mode for door images\",\n    \"description\": \"Select whether you want to set each custom door image yourself or let H5P do the work for you based on the calendar background image set in the behavioural settings.\",\n    \"options\": [\n      {\n        \"value\": \"manual\",\n        \"label\": \"I want to set each door image myself\"\n      },\n      {\n        \"value\": \"automatic\",\n        \"label\": \"H5P shall set the door images based on the background image\"\n      }\n    ],\n    \"default\": \"automatic\"\n  },\n  {\n    \"name\": \"doors\",\n    \"type\": \"list\",\n    \"label\": \"Doors\",\n    \"entity\": \"door\",\n    \"min\": 24,\n    \"max\": 24,\n    \"field\": {\n      \"name\": \"contentGroup\",\n      \"type\": \"group\",\n      \"fields\": [\n        {\n          \"name\": \"type\",\n          \"type\": \"select\",\n          \"label\": \"Content type\",\n          \"description\": \"Content type that shoud optionally pop up when the door is opened.\",\n          \"options\": [\n            {\n              \"value\": \"audio\",\n              \"label\": \"Audio\"\n            },\n            {\n              \"value\": \"image\",\n              \"label\": \"Image\"\n            },\n            {\n              \"value\": \"link\",\n              \"label\": \"Link\"\n            },\n            {\n              \"value\": \"text\",\n              \"label\": \"Text\"\n            },\n            {\n              \"value\": \"video\",\n              \"label\": \"Video\"\n            }\n          ]\n        },\n        {\n          \"name\": \"audio\",\n          \"type\": \"audio\",\n          \"label\": \"Audio\",\n          \"widget\": \"showWhen\",\n          \"showWhen\": {\n            \"rules\": [\n              {\n  