(127,'H5P.Crossword','Crossword',0,5,13,1,0,'iframe','dist/h5p-crossword.js','dist/h5p-crossword.css','','[\n  {\n    \"name\": \"taskDescription\",\n    \"label\": \"Task description\",\n    \"type\": \"text\",\n    \"widget\": \"html\",\n    \"importance\": \"high\",\n    \"description\": \"Describe your task here.\",\n    \"enterMode\": \"div\",\n    \"tags\": [\n      \"strong\",\n      \"em\",\n      \"u\",\n      \"a\",\n      \"ul\",\n      \"ol\",\n      \"h2\",\n      \"h3\",\n      \"hr\",\n      \"pre\",\n      \"code\"\n    ],\n    \"optional\": true\n  },\n  {\n    \"name\": \"words\",\n    \"label\": \"words\",\n    \"importance\": \"high\",\n    \"type\": \"list\",\n    \"widgets\": [\n      {\n        \"name\": \"VerticalTabs\",\n        \"label\": \"Default\"\n      }\n    ],\n    \"min\": 2,\n    \"entity\": \"Word\",\n    \"field\": {\n      \"name\": \"word\",\n      \"type\": \"group\",\n      \"label\": \"Word\",\n      \"fields\": [\n        {\n          \"name\": \"clue\",\n          \"type\": \"text\",\n          \"label\": \"Clue\",\n          \"description\": \"Clue that should point to the answer.\",\n          \"importance\": \"medium\"\n        },\n        {\n          \"name\": \"answer\",\n          \"type\": \"text\",\n          \"label\": \"Answer\",\n          \"description\": \"Answer to the clue.\",\n          \"importance\": \"medium\"\n        },\n        {\n          \"name\": \"extraClue\",\n          \"type\": \"library\",\n          \"label\": \"Extra clue\",\n          \"optional\": true,\n          \"options\": [\n            \"H5P.AdvancedText 1.1\",\n            \"H5P.Image 1.1\",\n            \"H5P.Audio 1.5\",\n            \"H5P.Video 1.6\"\n          ]\n        },\n        {\n          \"name\": \"fixWord\",\n          \"type\": \"boolean\",\n          \"label\": \"Fix word on grid\",\n          \"description\": \"Check if you want to fix the word to a particular position on the grid. Words with the same alignment ma